import React, { memo } from 'react';
import { useRoutes } from 'react-router-dom';
import routes from './router';
import logo from './logo.svg';
import './App.css';

const App = memo(() => {
  return (
    <div className='app'>
    <div className='header'>header</div>
    <div className='main'>
      { useRoutes(routes) }
    </div>
</div>
  )
})


export default App;
